var ground_images = [];

function prepareTopImages() {
    for (var a = 0; a < ground_base.length; a++)
        if (ground_base[a].top) {
            var b = Filters.getCanvas(54, 49),
                d = b.getContext("2d");
            Draw.clear(d);
            var e = ground_base[a].img,
                f = IMAGE_SHEET[e.sheet],
                g = f.tile_width * e.x,
                e = f.tile_height * e.y;
            d.drawImage(f.img[0], g, e, f.tile_width, f.tile_height, 0, 7, f.tile_width, f.tile_height);
            e = ground_base[a].top;
            f = IMAGE_SHEET[e.sheet];
            g = f.tile_width * e.x;
            e = f.tile_height * e.y;
            d.drawImage(f.img[0], g, e, f.tile_width, f.tile_height, 0, -16, f.tile_width, f.tile_height);
            ground_images[a] = {
                sheet: "top_" + a,
                x: 0,
                y: 0,
                url: "top_" + a
            };
            IMAGE_SHEET["top_" + a] = {
                img: [b],
                tile_width: 54,
                tile_height: 49,
                filters: !1,
                tile_half_width_floor: 27,
                tile_half_height_floor: 24
            }
        }
}
